import React from 'react';
import img1 from './Images/img1.png';
import img2 from './Images/img2.png';
const SectionA = ()=>{
    return(
        <>
            <br/>
            <br/>
            <div className='container mt-5'>
                <div className='row'>
                    <div className='col-lg-6 col-md-6 col-12 '>
                        <h2><span>A</span>BOUT ME</h2>
                        <p>They have not applied/received any other scholarship assistance under any other scheme. 
                        No action has been taken against them regarding serious mischief in accordance with the policy rules 
                        or moral standards of the educational institution. If they get assistance from 
                        any other scheme,then we will inform KCG,  Ahmedabad by sending a letter and through email 
                        on mysykcg@gmail.com.</p>
                        <p></p>

                    </div>
                    <div className='col-lg-6 col-md-6 col-12  sect-A'>
                        <img src={img2} alt='img2' className='img-fluid img2'/>
                        <img src={img1} alt='img1' className='img-responsive img1'/>
                    </div>
                </div>
            </div>
        </>
    );
};
export default SectionA;
